import React, { Component } from 'react';
import { Container, Jumbotron, ListGroup, Form, ButtonToolbar, Button, Row, Col, FormLabel} from 'react-bootstrap';
import './style.css';
// import {  Link } from 'react-router-dom';
// import DeliveryCost from '../DeliveryCost/DeliveryCost';
// import PossibleRoutes from '../PossibleRoutes/PossibleRoutes';
// import App from '../../App';
class NewLayout extends Component {
    constructor(props) {
        super(props);
            this.state={
                showDeliveryCost : false,
                showPossibleRoutes: false,
                showCompanyInfo: true,
            }
    }

    onClickPath(){
        this.setState({ showDeliveryCost: true });
        this.setState({ showCompanyInfo : false});
    }






    render() {
        return (
            <div className="layout">
                <Jumbotron fluid className="layout">
                    <Container>
                        <h1>Fluid jumbotron</h1>
                        <p>
                            This is a modified jumbotron that occupies the entire horizontal space of
                            its parent.
                        </p>

                        <br/>
                        <Row>
                            <Col xs={4}>
                                <ButtonToolbar>
                                    <Button variant="primary" size="md" active>
                                        Primary button
                                </Button>
                                </ButtonToolbar>
                            </Col>
                            <Col xs={4}>
                                <ButtonToolbar>
                                    <Button variant="primary" size="md" onClick={this.setState()}>
                                        Primary button
                                </Button>
                                </ButtonToolbar>
                            </Col>
                        </Row>


                        {this.state.showDeliveryCost && (<Container>


                            <Row>

                                <Col xs={1}><FormLabel>Route : </FormLabel></Col>
                                <Col xs={3}><Form.Control size="md" type="text" placeholder="Path" ></Form.Control></Col>
                                <Col xs={8}></Col>
                            </Row>
                            <br />
                            <Row>
                                <Col xs={1}></Col>
                                <Col xs={2}>
                                    <ButtonToolbar>
                                        <Button variant="primary" size="md" active>
                                            Primary button
                                </Button>
                                    </ButtonToolbar>
                                </Col>
                                <Col xs={9}></Col>

                            </Row>
                        </Container>)}


                       <Container>
                            <Row>

                                <Col xs={1}></Col>
                                <Col xs={3}>
                                    <ListGroup className="listGroup">
                                        <ListGroup.Item>Cras justo odio</ListGroup.Item>
                                        <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
                                        <ListGroup.Item>Morbi leo risus</ListGroup.Item>
                                        <ListGroup.Item>Porta ac consectetur ac</ListGroup.Item>
                                        <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
                                    </ListGroup>
                                </Col>
                                <Col xs={8}></Col>
                            </Row>


                       </Container>



                    </Container>
                </Jumbotron>
            </div>
        )
    }
}

export default NewLayout;
